import React from 'react';


function Component() {
    return (
      <div className="topnav" >

<h1>
        <a href='/home/index' style={{ textDecoration: 'none', color: 'black' }}>
          URL Shortener
        </a>
      </h1>


        <div class="dropdown">
        <a href="/home/index">
            <button class="btn btn-outline-primary" type="button">Home</button>
          </a>
        </div>
      </div>


    );
  }

  export default Component;
